// src/pages/portfolio/project/rootApp.js

import React from "react";
import { Helmet, HelmetProvider } from "react-helmet-async";
import { Container, Row, Col, Button } from "react-bootstrap";
import "../../style.css";

// 이미지 가져오기
import intendedUser from "./img/root/intendeduser.jpg";
import intendedUserMobile from "./img/root/rootMobile/intendeduser_mobile.jpg";
import personaDetail from "./img/root/personadetail.png";
import personaDetailMobile from "./img/root/rootMobile/personadetial_mobile.jpg";
import sketches1 from "./img/root/sketches1.jpg";
import sketches1Mobile from "./img/root/rootMobile/sketches1_mobile.jpg";
import storyboard from "./img/root/storyboard.jpg";
import storyboardMobile from "./img/root/rootMobile/storyboard_mobile.jpg";
import designVariations from "./img/root/DesignVariations.jpg";
import designVariationsMobile from "./img/root/rootMobile/DesignVariations_mobile.jpg";
import styleGuide from "./img/root/StyleGuide.jpg";
import styleGuideMobile from "./img/root/rootMobile/StyleGuide_mobile.jpg";

export const RootProject = () => {
  return (
    <HelmetProvider>
      <Container className="Project-header">
        <Helmet>
          <meta charSet="utf-8" />
          <title>Root Project | Portfolio</title>
          <meta name="description" content="Detailed page for the Root project" />
        </Helmet>

        <Row className="my-5">
          <Col>
            <h1>Root Project</h1>
            <p>
              ROOT is a family social communication application that allows users to engage, connect, 
              and share updates or news with their families abroad. The app is designed to be user-friendly 
              for seniors and includes thoughtful accessibility features.
            </p>
            <Button href="https://cloud.protopie.io/p/55dfd6f5ad?touchHint=true" target="_blank" className="projects__button">
              View Prototype
            </Button>
            <Button href="https://youtu.be/MSYDwU6HxOA" target="_blank" className="projects__button">
              View Promo Video
            </Button>
          </Col>
        </Row>

        <Section
          title="Idea & Interaction Framework"
          description="Based on our research and interviews, we targeted seniors over 75 who have family members across various countries. This app aims to help them feel connected despite geographical distances."
          imgDesktop={intendedUser}
          imgMobile={intendedUserMobile}
        />

        <Section
          title="Persona"
          subtitle="Persona 01"
          description="Our first persona is Judy, a 75-year-old woman with family in Japan and Seattle. She feels lonely but loves to take photos to capture memories. She wants a simple way to connect without dealing with time differences."
          imgDesktop={personaDetail}
          imgMobile={personaDetailMobile}
        />

        <Section
          title="Sketches"
          description="Initial sketches for the ROOT interface, focusing on ease of access to family updates, photos, and games. Key functionalities were designed for an accessible and intuitive experience for seniors."
          imgDesktop={sketches1}
          imgMobile={sketches1Mobile}
        />

        <Section
          title="Storyboard"
          description="A storyboard illustrating how Judy, a user, uses ROOT to send a scheduled morning message to her daughter in Japan."
          imgDesktop={storyboard}
          imgMobile={storyboardMobile}
        />

        <Section
          title="Design Variations"
          description="Three design iterations, focusing on readability and accessibility. We chose the third design with large buttons and clearer layouts."
          imgDesktop={designVariations}
          imgMobile={designVariationsMobile}
        />

        <Section
          title="Style Guide"
          description="The style guide features Roboto for readability and a warm orange primary color. Larger fonts and high-contrast elements were designed for accessibility."
          imgDesktop={styleGuide}
          imgMobile={styleGuideMobile}
        />

      </Container>
    </HelmetProvider>
  );
};

const Section = ({ title, subtitle, description, imgDesktop, imgMobile }) => (
  <Row className="my-5">
    <Col>
      <h3 className="explain__title">{title}</h3>
      {subtitle && <h5 className="explain__subtitle">{subtitle}</h5>}
      <p>{description}</p>
      <div className="img-box">
        <img src={imgDesktop} alt={title} className="explain-img-pc" />
        <img src={imgMobile} alt={title} className="explain-img-mobile" />
      </div>
    </Col>
  </Row>
);

export default RootProject;
